DESCRIPTION:
Beau T3 spacieux, meublé et équipé. L'appartement se trouve au 1er étage dans un immeuble très bien entretenu, avec un ascenseur. Il est à proximité de restaurants, de différents commerces et du Parc de la Planchette. Il se trouve à 5 minutes à pied de l'arrêt Anatole France, desservi par la ligne de métro 3.

Le T3 est constitué:
- d'un grand séjour avec un grand canapé, une table basse, une étagère et une grande TV 
   murale;
- d'une chambre spacieuse avec un grand lit pour 2 personnes, de deux tables de chevet, de 
   deux étagères et d'une grande buanderie;
- d'une seconde pièce pouvant faire office de bureau ou de chambre pour enfant;
- d'une grande cuisine à l'américaine avec une table bar, un four, un four micro-ondes, une 
   plaque de cuisson, des placards et autres espaces de rangements, d'un réfrigérateur, d'un 
   lave-linge et d'un lave-vaisselle;
- d'une belle salle de bain moderne;
- de toilettes séparées.

Accès au bâtiment par vigik et digicode. Internet par fibre. Eau chaude et chauffage individuels à l'électricité.

Dépôt de garantie de 3 500 € (2 mois de loyer, hors charges). Honoraires de 1 020 € TTC, dont 204 € TTC de frais d'état des lieux.

Résidence principale uniquement. Logement non adapté à la colocation. Dossier étudiant non accepté. Garantie Visale acceptée.

Pour organiser une visite, le processus est automatisé : vous pouvez réserver directement sur notre site internet ! Sinon,  vous pouvez cliquer sur "envoyer un mail" pour poursuivre les démarches de réservation.
